import React from 'react';

const TextEditor = () => {
    return (
        <div className='containder w-1/2 h-1/2 bg-slate-50 rounded-md'>
            <div className='flex flex-row items-center justify-start'>
            <box-icon name='bold' ></box-icon>
            </div>
        </div>
    );
};

export default TextEditor;
